(7, '2024-02-19', '2024-02-19', 1, 'Bonjour, Par la présente, je sollicite votre autorisation pour pouvoir m&#039;absenter de l&#039;entreprise le 19/02/2024. En effet, je dois à cette date être au batême de ma grande sœur et je suis en partie responsable de l&#039;organisation.\r\n\r\nComptant sur votre validation, je vous pris de bien vouloir valider ma demande.\r\n\r\nCordialement,\r\n', 'Demande validée', 1526, 1517, 1511, '', '', NULL, NULL, NULL, 3, '2024-02-16 11:03:29', '2024-02-16 16:44:57', 1, 3, '2024-02-16 10:39:11'),
