(17, '2024-03-22', '2024-03-25', 3, 'Bonjour,\r\n\r\nje viens par la présente sollicité une demande d&#039;autorisation d&#039;absence du 21 au 25 Mars 2024.\r\n\r\nEn raison des élections présidentielle prévu le 24 Mars 2024, étant mandataire de la coalition DIOMAYE PRESIDENT au niveau de mon village au Fouta (MATAM), je souhaiterais de ce congé de pour bien préparer avec mes représentant de notre centre.\r\n\r\nA l&#039;attente d&#039;une suite favorable, je vous prie de bien recevoir mes salutations les meilleures. ', 'Demande validée', 1516, 1512, 1511, '', '', NULL, NULL, NULL, 3, '2024-03-09 14:23:14', '2024-03-11 09:46:03', 1, 3, '2024-03-08 17:24:29'),
