(23, '2024-03-28', '2024-03-29', 2, 'préparatifs de la  fête de Pâques et accomplir  la démarche de fois du chemin de la croix vivant  du Vendredi saint ', 'Demande validée', 1514, 1512, 1511, '', '', NULL, NULL, NULL, 4, '2024-03-26 11:08:46', '2024-03-27 13:28:32', 0, 3, '2024-03-26 10:59:37'),
(24, '2024-03-28', '2024-03-29', 2, 'Suite à mon état de fatigue mentale et physique, je sollicite l&#039;autorisation de rester à la maison ce mercredi et ce jeudi et de travailler à distance. J&#039;ai déjà évoqué ce sujet avec Monsieur MBAYE. Je prévois donc de reprendre mes activités dès lundi inchallah. Merci pour votre compréhension.', 'Demande validée', 1528, 1517, 1511, '', '', NULL, NULL, NULL, 3, '2024-03-28 17:21:42', '2024-03-29 09:12:53', 1, 3, '2024-03-27 16:55:57'),
