INSERT INTO `rapport_control` (`id`, `date_controle`, `heure_controle`, `controle`, `rapport_control`, `id_gardien`, `suivi`, `pj`, `id_controleur`, `id_user`, `date_enregistrement`) VALUES
(1, '2021-01-13', '00:30:00', 'Surpris en train de dormir', 'Site marché kermel l\'agent Patrick Rachid Agboton trouvé entrain de dormir .', 68, 'ADS en question n\'est pas un exemple de bon agent .', 'documents/rapport_control/1/PJ.pdf', 42, 4, '2021-02-02 16:13:47'),
(2, '2021-01-19', '00:09:00', 'Surpris en train de dormir', 'Site coris siège  l\' ADS Abdou Aziz NDIAYE trouvé entrain de dormir .', 40, 'Pour la première fois Ya un rapport sur cet agent .', 'documents/rapport_control/2/PJ.pdf', 42, 4, '2021-02-02 16:22:53'),
(3, '2021-01-29', '05:19:00', 'Surpris en train de dormir', 'Site  électra  2. l\'agent en question est un grand dormeur .', 86, 'Mise a pied deux jours plus sanction pécuniaire  .', 'documents/rapport_control/3/PJ.pdf', 142, 4, '2021-02-02 16:40:49'),
(4, '2021-01-27', '23:30:00', 'Surpris en train de dormir', 'le contrôleur le trouve encore endormi .', 86, 'Son cas a revoir .', 'documents/rapport_control/4/pj.pdf', 42, 4, '2021-02-02 17:39:57'),
(5, '2021-01-03', '00:15:00', 'Surpris en train de dormir', 'le contrôleur le trouve entrain de dormir vers 01h 43 ', 182, 'Un avertissement a son égard . ', '', 42, 4, '2021-02-08 17:24:43'),
(6, '2021-01-03', '04:20:00', 'Surpris en train de dormir', 'Le contrôleur le trouve entrain de dormir .', 86, 'Une mise a pied de 02 jours .', '', 42, 4, '2021-02-08 18:06:28'),
(7, '2021-01-19', '00:00:00', 'Surpris en train de dormir', 'Le contrôleur le trouve entrain de dormir .', 163, 'Un deuxième avertissement a son égard .', '', 42, 4, '2021-02-08 18:12:46'),
(8, '2021-02-13', '11:41:00', 'Tenue de travail non conforme', 'Qu\'il trouve l\'agent François Diouf avec une casquette verte ,téléphone accroché a l\'oreille ,chaussure porté comme sandale .\r\nIl le déclare comme un mauvais élément .', 125, 'Refus catégorique de répondre a la convocation .\r\nMonsieur Samba service juridique me fait comprendre de patienter jusqu\'à l\'enregistrement complet de son dossier au niveau de l\'inspection .\r\nOn pourra lui trouver facilement une porte de sortie .', '', 13, 4, '2021-03-11 10:29:04'),
(9, '2021-02-13', '11:17:00', 'Tenue de travail non conforme', 'Il déclare l\'agent Mamadou Dia Seydina n\'était pas en tenue correct pas de chemise Vigilus ni cravate . Il lui a donné un avertissement . ', 43, 'Néanmoins l\'agent est convoqué a la direction pour demande d\'explication .\r\nSa version est qu\'il a oublié .', '', 13, 4, '2021-03-11 10:38:26'),
